import React from 'react';
import { H1, TitleDiv } from './styles';

const Title = () => {
	return (
		<TitleDiv>
			<div>
				<i className="fas fa-book-open" />
				<H1>Journals</H1>
			</div>
		</TitleDiv>
	);
};

export default Title;
